import styled from 'styled-components'
import lottie from "lottie-web";
import animationData from "../assets/LottieJson/cover.json";
import LottieAnimation from "../lottieScripts/LottieAnimation";


const VideoContainer = styled.div`
width: 400%;
height: auto;
position: relative;
// bottom: 30vh;

display: flex;
justify-content: center;
align-items: center;
right: 42vw;
z-index: -1;
`

const style = {
    width: "60%",
    bottom: "1vh",
    // left: "20vh",
    zIndex: -1,
    // overflow: "hidden",
    position: "absolute",
}

const CoverVideo = () => {
  return (
    <VideoContainer>
        <LottieAnimation animationData={animationData} style={style}></LottieAnimation>
    </VideoContainer>
    
   
  )
}
